      {/* Card Section */}
      <div className='p-3'><a href="/second">
          <div className='w-64 bg-[#1e293b] '>
              <img src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR3LD15siaj7z8hBzK_VDL4REcpfWvj8q8A-8linIkuWaPWNT9l8czjbpWMq0OGfYxk_5k&usqp=CAU' />
              <p>
                  The scientific community is a diverse network of scientists collaborating to generate knowledge and solve complex problems
              </p>
          </div></a>
      </div>
  </div>
    },
    {path:"/second",
    element:<div>
        <Sidebar>
        </Sidebar>
        <Chat></Chat>
    </div>
}
]);
